Saving Kenya's Street Kids

Sociopolitical Documentary hosted by Aidan Hartley, published by Channel 4 broadcasted as part of CH4 Unreported World series in 2013 - English narration


Information
------------------------------

Aidan Hartley reports from his home town in Kenya on an extraordinary project to rescue the children who live on its streets. Together with director Wael Dabbous, Hartley highlights the inspiring work of the Restart Centre in Gilgil, which is providing a safe shelter for children at risk. The Restart Centre is run on a shoestring budget raised from private donations. Conditions are basic, but crucially, it represents safety for the 70 children who live there. Many of them ended up living rough as result of the bloody chaos that engulfed Kenya following disputed elections five years ago. More than 1000 people were killed, many families were broken up and thousands were made homeless.

